import React from "react";

class TodoForm extends React.Component {
    constructor(props) {
        super(props);
    }
    render(){
        return(
            <form>
                <input type="text" name="newtodo" placeholder="New Todo" />
                <button type="submit">Add Todo</button>
            </form>
        )

    }
}

export default TodoForm;
